import React from "react";
import "./GameCard.css";

const GameCard = props => (
  <div
      role="img"
      className={`gameCard`} 
      style={{ backgroundImage: `url("${props.item}")` }}
      onClick={() => props.handleClick(props.id)}
  /> 
);




export default GameCard;
